text:
배달도 빠르고 주문음식 모두 맛있네요~^^
탕수육 고기도 부드럽고~~!
참고로 해물짬뽕은 양이 너무많아 좀 남겼어요ㅡㅡ;

배달하시는 분 정말 불친절 하시네요.
아빠가 음식 받으시러 나갔는데 저 먼데서 불렀는데 바로 안나왔다고 엄청 화내셨어요 ;; 
두들기신것도 아니고 집이랑 떨어진곳에서 부르시고선 아빠한테 어마어마하게 화내시더라구요.. 듣는 제가 다 민망했네요 아빠 기분도 상하셨구요...
여름에 에어컨 키고 있는집들은 멀리서 부르는건 못 들을 수도 있는건데 어쩜 그렇게 화를 내시는지...;;
음식 맛도 썩 훌륭하지 않았는데 서비스가 최악이네요 아주 최악 
같은 돈이면 다른 곳에서 시켜드세요

여긴 음식맛 기복이 너무 심해요
자주시켜먹는데
오늘은 진짜 별로..;;
